import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

function AdminDashboardPage() {
  const API_URL = "http://localhost:5000/api";
  const [users, setUsers] = useState([]);  // Initialisé à un tableau vide
  const [orders, setOrders] = useState([]);  // Initialisé à un tableau vide
  const [carts, setCarts] = useState([]);  // Initialisé à un tableau vide
  const [addresses, setAddresses] = useState([]);  // Initialisé à un tableau vide
  const navigate = useNavigate();

  useEffect(() => {
    const email = localStorage.getItem("email");

    if (email !== "rngasseu123@gmail.com") {
      navigate("/");
      return;
    }

    // Charger tous les éléments
    fetch(`${API_URL}/admin/users?email=${email}`)
      .then((res) => res.json())
      .then((data) => {
        setUsers(data || []);  // Vérifier si data est défini avant de l'utiliser
      })
      .catch((error) => console.error("Erreur chargement utilisateurs:", error));

    fetch(`${API_URL}/admin/orders?email=${email}`)
      .then((res) => res.json())
      .then((data) => {
        setOrders(data || []);  // Si data est undefined, on affecte un tableau vide
      })
      .catch((error) => console.error("Erreur chargement commandes:", error));

    fetch(`${API_URL}/admin/carts?email=${email}`)
      .then((res) => res.json())
      .then((data) => {
        setCarts(data || []);  // Même logique ici
      })
      .catch((error) => console.error("Erreur chargement paniers:", error));

    fetch(`${API_URL}/admin/addresses?email=${email}`)
      .then((res) => res.json())
      .then((data) => {
        setAddresses(data || []);  // Et ici aussi
      })
      .catch((error) => console.error("Erreur chargement adresses:", error));
  }, [navigate]);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Tableau de bord Administrateur</h1>

      {/* Utilisateurs */}
      <section style={{ marginTop: "40px" }}>
        {users.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr style={{ backgroundColor: "#f5f5f5" }}>
                <th style={thStyle}>Nom</th>
                <th style={thStyle}>Email</th>
                <th style={thStyle}>Rôle</th>
                <th style={thStyle}>Actions</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user) => (
                <tr key={user._id}>
                  <td style={tdStyle}>{user.name}</td>
                  <td style={tdStyle}>{user.email}</td>
                  <td style={tdStyle}>{user.isAdmin ? "Admin" : "Client"}</td>
                  <td style={tdStyle}>
                    <button style={buttonStyle}>Modifier</button>
                    <button style={{ ...buttonStyle, color: "red" }}>Supprimer</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucun utilisateur trouvé.</p>
        )}
      </section>

      {/* Commandes */}
      <section style={{ marginTop: "40px" }}>
        <h2>Commandes</h2>
        {orders.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr style={{ backgroundColor: "#f5f5f5" }}>
                <th style={thStyle}>ID Commande</th>
                <th style={thStyle}>Total</th>
                <th style={thStyle}>Status</th>
              </tr>
            </thead>
            <tbody>
              {orders.map((order) => (
                <tr key={order._id}>
                  <td style={tdStyle}>{order._id}</td>
                  <td style={tdStyle}>{order.total} €</td>
                  <td style={tdStyle}>{order.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucune commande trouvée.</p>
        )}
      </section>

      {/* Paniers */}
      <section style={{ marginTop: "40px" }}>
        <h2>Paniers</h2>
        {carts.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr style={{ backgroundColor: "#f5f5f5" }}>
                <th style={thStyle}>ID Panier</th>
                <th style={thStyle}>Utilisateur</th>
                <th style={thStyle}>Nombre de produits</th>
              </tr>
            </thead>
            <tbody>
              {carts.map((cart) => (
                <tr key={cart._id}>
                  <td style={tdStyle}>{cart._id}</td>
                  <td style={tdStyle}>{cart.userId}</td>
                  <td style={tdStyle}>{cart.items.length}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucun panier trouvé.</p>
        )}
      </section>

      {/* Adresses */}
      <section style={{ marginTop: "40px" }}>
        <h2>Adresses</h2>
        {addresses.length > 0 ? (
          <table style={tableStyle}>
            <thead>
              <tr style={{ backgroundColor: "#f5f5f5" }}>
                <th style={thStyle}>ID</th>
                <th style={thStyle}>Utilisateur</th>
                <th style={thStyle}>Adresse</th>
              </tr>
            </thead>
            <tbody>
              {addresses.map((address) => (
                <tr key={address._id}>
                  <td style={tdStyle}>{address._id}</td>
                  <td style={tdStyle}>{address.user}</td>
                  <td style={tdStyle}>
                    {address.street}, {address.city}, {address.postalCode}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Aucune adresse trouvée.</p>
        )}
      </section>
    </div>
  );
}

const tableStyle = {
  width: "100%",
  borderCollapse: "collapse",
  marginBottom: "20px",
};

const thStyle = {
  border: "1px solid #ddd",
  padding: "8px",
  textAlign: "left",
  backgroundColor: "#f5f5f5",
};

const tdStyle = {
  border: "1px solid #ddd",
  padding: "8px",
};

const buttonStyle = {
  padding: "6px 12px",
  backgroundColor: "#4CAF50",
  color: "white",
  border: "none",
  cursor: "pointer",
  borderRadius: "4px",
};

export default AdminDashboardPage;
